full_text:
Coaches: Make your practices the BEST part of your kids' day. 

This pandemic has been incredibly hard on school aged kids. Lets remember to not get so wrapped up in development or achievement that we forget to have fun and smile with our kids.

@mplegends

Don't forget to watch 'GOODBYE 2020: You, Me &amp; Pandemic' - a recap of the year that will go down in history, that we'll tell our children and grandchildren about, and become subjects of research in the future.

Tonight | 10 PM

@tanvishukla

Wishing a very happy birthday to one of our viewers Bob River who turns 100-years-old today! The U.S. Army veteran of World War II was also the first to receive the COVID-19 vaccine at Truman Veterans' Hospital in Columbia, Missouri.

